import { mount, route } from 'navi'
import SignIn from './pages/SignIn'
import SignUp from './pages/SignUp'
import React from 'react'
import Main from './pages/Main'
import { withAuthentication } from './auth/authenticatedRoute'

const App = mount({
  '/': withAuthentication(
    route({
      title: 'Login',
      view: <SignIn />,
    })
  ),
  '/register': route({
    title: 'Register',
    view: <SignUp />,
  }),
  '/main': route({
    title: 'Main',
    view: <Main />,
  }),
})

export default App
